import React from "react";

export default function TaskSummary({ summary }) {
  return React.createElement(
    "div",
    { style: { marginBottom: 20, border: "1px solid #ddd", padding: 10 } },
    React.createElement("h4", null, "Task Summary"),
    React.createElement("p", null, "Total: ", summary.total_tasks || 0),
    React.createElement("p", null, "Completed: ", summary.completed_tasks || 0),
    React.createElement("p", null, "Pending: ", summary.pending_tasks || 0),
    React.createElement("p", null, "Completion Rate: ", (summary.completion_rate_percent || 0), "%")
  );
}
